import React from "react";
import { lookup } from "./constants.js";
const Icon = ({ title, createPanel }) => {
  const ispanel = lookup[title]["ispanel"]; //display panel or link to html an anonymous function just because
  const returnHTML = lookup[title]["returnHTML"];
  return (
    <div
      onClick={(event) =>
        ispanel
          ? createPanel(title, returnHTML)
          : window.open(returnHTML, "_blank")
      }
      className="icon"
    >
      <a className="icon-anchor" href="/#">
        <img
          className="icon-img"
          src={require("./assets/image.png")}
          alt="123"
        />
        <span className="icon-name">{title}</span>
      </a>
    </div>
  );
};

export default Icon;
